import React from "react";
import "./store_product-grid.css";

import StoreProductCard from "../common/StoreProductCard";

import productImg from "../../assets/images/products/product-01.jpg";
import shoppingbag from "../../assets/icons/shopping-bag.svg";
import quicklook from "../../assets/icons/eye.svg";

const index = () => {
  return (
    <div className="store__grid-container">
      <div className="store__grid store__container">
        <StoreProductCard
          productImage={productImg}
          bagIcon={shoppingbag}
          eyeIcon={quicklook}
        />
        <StoreProductCard
          productImage={productImg}
          bagIcon={shoppingbag}
          eyeIcon={quicklook}
        />
        <StoreProductCard
          productImage={productImg}
          bagIcon={shoppingbag}
          eyeIcon={quicklook}
        />
        <StoreProductCard
          productImage={productImg}
          bagIcon={shoppingbag}
          eyeIcon={quicklook}
        />
      </div>
    </div>
  );
};

export default index;
